import React from 'react';
import { FaEnvelope, FaLinkedinIn, FaInstagram } from 'react-icons/fa';

import { Container } from './styles';

const ContactCard = ({ text, icon }) => {
  const showIcon = (icon) => {
    switch (icon) {
      case 'email':
        return <FaEnvelope />;
      case 'linkedin':
        return <FaLinkedinIn />;

      default:
        return <FaInstagram />;
        break;
    }
  };
  return (
    <Container>
      <a href={`http://${text}`} target="_blank" rel="noopener noreferrer">
        {text}
      </a>
    </Container>
  );
};

// ContactCard.defaultProps = ({
//   icon: email!
// })

export default ContactCard;
